import React from 'react';
import Body from './Body'; // Body 컴포넌트를 임포트합니다.
import styles from './Loginpage.module.css'; // CSS 모듈 파일 임포트

function LoginPage() {
    return (
        <div>
            <Body />
            <img src="man3.png" alt="Decorative Image" className={styles.decorativeImage} />
        </div>
    );
}

export default LoginPage;
